import { Box, Typography } from "@material-ui/core";

const PageContainer = ({ children, title }: { children: any; title: string; }) => {
  return (
    <Box m={4}>
      <PageHeader>
        <Typography variant="h5" color="primary">
          {title}
        </Typography>
        {children}
      </PageHeader>
    </Box>
  )
}

export default PageContainer;
